import React from 'react';
import { Container, Card, Row, Col } from 'react-bootstrap';
import './Mindfulness.css';

const Mindfulness = () => {
  const mindfulnessExercises = [
    {
      title: "Mindful Breathing",
      description: "Focus on your breath for 5 minutes. Notice the sensation of breathing in and out.",
      steps: [
        "Find a comfortable sitting position",
        "Close your eyes or maintain a soft gaze",
        "Focus on your natural breath",
        "Notice the rise and fall of your chest",
        "When your mind wanders, gently return to the breath"
      ],
      color: "gradient-purple"
    },
    {
      title: "Body Scan",
      description: "Gradually focus your attention on different parts of your body, from toes to head.",
      steps: [
        "Lie down in a comfortable position",
        "Start focusing on your toes",
        "Slowly move your attention upward",
        "Notice any sensations or tension",
        "Release tension as you move up"
      ],
      color: "gradient-blue"
    },
    {
      title: "5-4-3-2-1 Grounding",
      description: "Use your senses to ground yourself in the present moment.",
      steps: [
        "Name 5 things you can see",
        "Name 4 things you can touch",
        "Name 3 things you can hear",
        "Name 2 things you can smell",
        "Name 1 thing you can taste"
      ],
      color: "gradient-green"
    },
    {
      title: "Mindful Walking",
      description: "Practice mindfulness while walking, focusing on each step and movement.",
      steps: [
        "Walk at a natural pace",
        "Notice the sensation in your feet",
        "Feel the movement of your legs",
        "Observe your posture and balance",
        "Stay present with each step"
      ],
      color: "gradient-orange"
    },
    {
      title: "Loving-Kindness",
      description: "Direct positive thoughts and wishes toward yourself and others.",
      steps: [
        "Start with self-compassion",
        "Extend to loved ones",
        "Include neutral people",
        "Include difficult people",
        "Extend to all beings"
      ],
      color: "gradient-pink"
    },
    {
      title: "Mindful Eating",
      description: "Practice being present and aware while eating.",
      steps: [
        "Observe the food's appearance",
        "Notice the aroma",
        "Take small, mindful bites",
        "Chew slowly and deliberately",
        "Experience all the flavors"
      ],
      color: "gradient-yellow"
    }
  ];

  return (
    <Container className="mindfulness-container py-5">
      <h1 className="text-center mb-5 mindfulness-title">Mindfulness Practices</h1>
      <p className="text-center main-description mb-5">
        Mindfulness is the practice of being present and fully engaged with 
        whatever we're doing at the moment, free from distraction or judgment.
      </p>

      <Row>
        {mindfulnessExercises.map((exercise, index) => (
          <Col md={4} className="mb-4" key={index}>
            <Card className={`mindfulness-card ${exercise.color}`}>
              <Card.Body>
                <Card.Title className="exercise-title mb-3">
                  {exercise.title}
                </Card.Title>
                <Card.Text className="exercise-description">
                  {exercise.description}
                </Card.Text>
                <div className="steps-container">
                  <h6 className="steps-title">Practice Steps:</h6>
                  <ol className="steps-list">
                    {exercise.steps.map((step, stepIndex) => (
                      <li key={stepIndex}>{step}</li>
                    ))}
                  </ol>
                </div>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default Mindfulness;
